import React from "react";
import Navbar from "./component/Navbar/Navbar";
import ListSertifikat from "./component/ListSertifikat/ListSertifikat";
import { Container, Box } from "@mui/material";

function App() {
  return (
    <div className="App">
      <Container>
        <Navbar />
        <Box sx={{ mt: 9 }}>
          <ListSertifikat />
        </Box>
      </Container>
    </div>
  );
}

export default App;
